import React from 'react';

const styles = {
  footer: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    height: '100%',
    background: '#dad7cd',
  }
};

export default function Footer() {
  return (
    <div style={styles.footer}>
      <p>GitHub</p>

 <i class="fa-brands fa-github"></i>
      <p>LinkedIn</p>
      </div>
  );
}
